import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Hero from './components/Hero';
import Projects from './components/Projects';
import Contact from './components/Contact';
import Pawmeet from './pages/Pawmeet';
import InfoSafe from './pages/InfoSafe';
import UrbanLegend from './pages/UrbanLegend';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={
            <>
              <Hero />
              <Projects />
              <Contact />
            </>
          } />
          <Route path="/pawmeet" element={<Pawmeet />} />
          <Route path="/infosafe" element={<InfoSafe />} />
          <Route path="/urban-legend" element={<UrbanLegend />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
